window.bookSummaryJSON = "<p>Blood might be thicker than water, but venom is stronger than just about anything… </p> <p>It was supposed to be a nice, quiet, simple dinner with friends - but nothing is ever nice, quiet, or simple when you’re Gin Blanco, the Spider, notorious assassin and current queen of the Ashland underworld. </p> <p>This time around, someone seems to be targeting Stuart Mosley, the president of First Trust bank. Lots of people have grudges against Mosley, but the more I investigate, the more Mosley’s problems seem to be connected to some of my own, especially when it comes to the Circle, the evil, shadowy group that is secretly responsible for much of the crime and corruption in Ashland. </p> <p>But when another blast from my dark and deadly past as the Spider comes to light, I wonder if I’ll be able to survive this dangerous new enemy, who has a burning thirst for revenge that will only be satisfied with one thing: my death.</p>"; 
